import "./topBar.css";
import girlTop from "./images/beauty.png";
import { Link } from "react-router-dom";
import { useContext } from "react";
import { Context } from "../context/Context";

function TopBar() {
  const { user, dispatch } = useContext(Context);

  const handleLogOut = () => {
    dispatch({ type: "LOGOUT" });
  };

  return (
    <div className="top">
      <div className="topLeft">Facebook Twitter Pinterest Instagram</div>
      <div className="topCenter">
        <ul className="topList">
          <li className="topIcon topListItem">
            <Link to="/" className="link">
              HOME
            </Link>
          </li>
          <li className="topIcon topListItem">
            <Link to="/about" className="link">
              ABOUT
            </Link>
          </li>
          <li className="topIcon topListItem">
            <Link to="/contact" className="link">
              CONTACT
            </Link>
          </li>
          <li className="topIcon topListItem">
            <Link to="/write" className="link">
              WRITE
            </Link>
          </li>
          <li className="topIcon topListItem" onClick={handleLogOut}>
            {user && "LOGOUT"}
          </li>
        </ul>
      </div>
      <div className="topRight">
        {user ? (
          <img src={girlTop} className="topImg" alt="" />
        ) : (
          <ul className="topList">
            <li className="topListItem">
              <Link to="/login" className="link">
                LOGIN
              </Link>
            </li>

            <li className="topListItem">
              <Link to="/register" className="link">
                REGISTER
              </Link>
            </li>
          </ul>
        )}
        <i className="topSearchIcon fa fa-search"></i>
      </div>
    </div>
  );
}

export default TopBar;
